import "./AdminLayout.css";
import AdminNavbar from "./adminNavbar";

export default function AdminLayout({ children }) {
  return (
    <div className="admin-layout">
      <AdminNavbar />
      <div className="admin-content">{children}</div>
    </div>
  );
}
